import React from "react";
import "./Apps.css";

const apps = [
  { name: "Coin", url: "https://coin.zerodha.com/", desc: "Mutual Funds investment platform" },
  { name: "Varsity", url: "https://zerodha.com/varsity/", desc: "Free stock market education" },
  { name: "Streak", url: "https://www.streak.tech/", desc: "Algo trading without coding" },
  { name: "Smallcase", url: "https://www.smallcase.com/", desc: "Thematic investment portfolios" },
  { name: "Sensibull", url: "https://sensibull.com/", desc: "Options trading simplified" },
];

const Apps = () => {
  return (
    <div className="apps-wrapper">
      <h2>Apps & Integrations</h2>
      <div className="apps-grid">
        {apps.map((app) => (
          <a key={app.name} href={app.url} target="_blank" rel="noopener noreferrer" className="app-card">
            <h3>{app.name}</h3>
            <p>{app.desc}</p>
          </a>
        ))}
      </div>
    </div>
  );
};

export default Apps;
